-// isTypeLit reports whether x is a type literal.
-// Note that *T is considered a type literal but
-// it may also be a pointer dereferenciation.
+// isTypeLit reports whether x is a (possibly parenthesized) type literal.
 func isTypeLit(x Expr) bool {
 	switch x := x.(type) {
 	case *ArrayType, *StructType, *FuncType, *InterfaceType, *SliceType, *MapType, *ChanType:
 		return true
 	case *Operation:
-		// Subtle: If *T is a pointer dereferenciation (not a type) it will
-		// not be a constant value, and thus cannot be a valid array length.
-		return x.Op == Mul && x.Y == nil
